define('text!styles/colors.html', ['module'], function(module) { module.exports = "<!--\n// @author      : Adarsh Pastakia\n// @copyright   : 2016\n// @license     : MIT\n-->\n<template>\n  <style>\n    .color-card {\n      border: 1px solid silver;\n      border-radius: 12px;\n      display: inline-block;\n      margin: 0.5em;\n      overflow: hidden;\n    }\n\n    .color-card .color {\n      text-align: center;\n      width: 6em;\n      height: 3em;\n    }\n\n    .color-card .color button {\n      font-size: 1.5em;\n      width: 5em;\n      height: 2em;\n      padding: 0.5em 0;\n      text-shadow: 0 0 1px white;\n    }\n\n    .color-card p {\n      font-size: 10px;\n    }\n\n  </style>\n  <ui-content scroll padded>\n    <h2 class=\"ui-text-primary\">\n      <a href=\"//www.copicmarker.com\" target=\"_blank\">Copic Markers 358 Color Chart</a>\n    </h2>\n    <div>\n      <ui-option-group auto-width label=\"Click color to copy\" name=\"radio\" value.bind=\"optVal\">\n        <ui-radio value=\"1\">SASS Variable</ui-radio>\n        <ui-radio value=\"2\">Color Hex</ui-radio>\n      </ui-option-group>\n    </div>\n    <hr/>\n    <div repeat.for=\"k of colors | keys\">\n      <h5>${k}</h5>\n      <div class=\"color-card\" repeat.for=\"c of colors[k] | keys\">\n        <div class=\"color\" css.bind=\"{background:colors[k][c]}\">&nbsp;\n          <!-- <button data-clipboard-text.bind=\"optVal==1?c:colors[k][c]\" tabindex=\"-1\"></button> -->\n        </div>\n        <p class=\"ui-text-center ui-selectable\">${c}</p>\n      </div>\n    </div>\n  </ui-content>\n</template>"; });
define('text!styles/hlight.html', ['module'], function(module) { module.exports = "<!--\n// @author      : Adarsh Pastakia\n// @copyright   : 2016\n// @license     : MIT\n-->\n<template>\n  <ui-content scroll padded>\n    <div class=\"ui-margin-v\">\n      <pre markdown>\n        <xmp>\n        ```html\n        <ui-button primary icon.bind=\"glyph class\" disabled=\"bool\" click.trigger=\"fn()\">Label</ui-button>\n        ```\n        \n        ```scss\n        $primary: #899809 !default;\n        @mixin test() {\n          border: 1px solid $primary;\n        }\n        \n        .borderer {\n          @include test();\n        }\n        ```\n        \n        ```ts\n        import {ClassName} from \"module\";\n        \n        @autoinject()\n        export class MyName extends BaseClass {\n          public _int:Number = 10;\n          private _str:String = \"Hello\";\n          private _map:Map<string, Object> = null;\n          \n          @bindable({mode: two})\n          class:string = '';\n          \n          constructor(public x:App) {\n          }\n          \n          // Comment\n          attached() {\n            x = () => {\n              return test;\n            }\n            \n            this.test();\n            \n            return null;\n          }\n        }\n        ```\n        </xmp>\n      </pre>\n    </div>\n  </ui-content>\n</template>"; });
