      keyword:
        // kind:
        'thing|10 room|10 person|10 man|10 woman|10 animal|10 container ' +
        'supporter|10 backdrop|10 door|10 ' +
        // characteristic:
        'scenery|10 open closed|10 locked|10 inside|10 gender|10 ' +
        // verb:
        'is are say|10 understand|10 ' +
        // misc keyword:
        'kind|10 of rule|10'
